import {useDispatch, useSelector} from 'react-redux';
import { loadDropboxData } from "./actions";
import axios from "axios";




function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(loadDropboxData())
  }, [])
  return (
    <>
      hello
    </>
  )
}

